''' Set the Unit Procedure Start Time ''' import system from ils.sfc.gateway.api import s88Set, s88Get, getDatabaseName, getProviderName, getChartLogger from ils.sfc.common.constants import LOCAL_SCOPE, SUPERIOR_SCOPE, PHASE_SCOPE, OPERATION_SCOPE, GLOBAL_SCOPE
def onStart(chart,block): log = getChartLogger(chart) log.tracef("In %s, setting the unit start time...", block.get("name","")) s88Set(chart, block, "unit-procedure-start-time.command", "START", GLOBAL_SCOPE) log.tracef("%s has completed!", block.get("name",""))
